### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. Search Algorithms
**Core Topics and Concepts:**
- **Depth-First Search (DFS):** Explores as far as possible along each branch before backtracking.
- **Breadth-First Search (BFS):** Explores all neighbors at the present depth before moving on to nodes at the next depth level.
- **Best-First Search:** Uses a priority queue to explore the most promising node first, often based on a heuristic.
- **Hill Climbing:** A local search algorithm that continuously moves in the direction of increasing value or decreasing cost.
- **Depth-First Iterative Deepening (DFID):** Combines DFS and BFS to find the shortest path with optimal memory usage.

**Principles:**
- **Node Inspection:** Involves picking a node from the OPEN list, performing a goal test, and generating neighbors.
- **Manhattan Distance:** A heuristic used to estimate the distance between two points in a grid.
- **MoveGen Function:** Returns neighbors in a specific order (e.g., alphabetical).
- **RemoveSeen Procedure:** Removes neighbors already present in OPEN/CLOSED lists to avoid revisiting.

#### 2. Ant Colony Optimization (ACO)
**Core Topics and Concepts:**
- **ACO for TSP:** Each ant constructs a tour independently, using pheromone trails to guide the search.
- **Pheromone Update:** Pheromones are updated based on the quality of the tours constructed by the ants.

**Principles:**
- **Collaborative Filtering:** Ants collaborate indirectly through pheromone trails.
- **Independent Construction:** Each ant constructs a solution independently.

#### 3. Genetic Algorithms
**Core Topics and Concepts:**
- **Tour Representation:** Representing a tour as a sequence of cities.
- **Adjacency Representation:** Representing a tour based on the adjacency of cities.
- **Ordinal Representation:** Converting a path representation to an ordinal representation.

**Principles:**
- **Path Representation:** A sequence of cities visited in order.
- **Adjacency Representation:** A sequence based on the adjacency of cities in the tour.
- **Ordinal Representation:** A numerical representation of the tour based on the order of visits.

#### 4. Traveling Salesman Problem (TSP)
**Core Topics and Concepts:**
- **Nearest Neighbor Heuristic:** Constructs a tour by repeatedly visiting the nearest unvisited city.
- **Greedy Heuristic:** Constructs a tour by making the locally optimal choice at each step.
- **Savings Heuristic:** Constructs a tour by calculating savings from merging routes.

**Principles:**
- **Distance Matrix:** A matrix representing the distances between cities.
- **Tour Cost:** The total cost of a tour, calculated as the sum of the distances between consecutive cities.

**Equations:**
- **Manhattan Distance:** \( |x_1 - x_2| + |y_1 - y_2| \)
- **Tour Cost:** \( \sum_{i=1}^{n-1} d(c_i, c_{i+1}) + d(c_n, c_1) \), where \( d(c_i, c_j) \) is the distance between city \( c_i \) and \( c_j \).

